import React from 'react'
import { useSelector } from 'react-redux';

const EventsTable = ({events}) => {
const user = useSelector((state)=> state.authReducer?.user.id);
    return (
        <table class="table table-hover">
    <thead>
      <tr>
        <th>Event Name</th>
        <th>Location</th>
        <th>Start Date</th>
        <th>End Date</th>
        <th>Submitted At</th>
        <th></th>
      </tr>
    </thead>
    <tbody>
        {events.map((event, index)=>{
            return (<tr key={index}>
                <td>{event.name}</td>
                <td>{event.location}</td>
                <td>{event.startDate}</td>
                <td>{event.endDate}</td>
                <td>{event.submittedAt}</td>
                {user==event.user && <td><button type="button" class="btn btn-danger">&#x2715;</button></td> } 
            </tr>)
        })}
        </tbody>
        </table>
    )
}

export default EventsTable;
